$('body').delegate("a", "click", function() {
  var urlchiffree = $(this).attr('href');
  if (urlchiffree.indexOf("dealabs.com/visit/thread/") >= 0) {
    urlcleaner(urlchiffree);
    return false;
  }
});
$("a").click( function() {
  var urlchiffree = $(this).attr('href');
  if (urlchiffree.indexOf("dealabs.com/visit/thread/") >= 0) {
    urlcleaner(urlchiffree);
    return false;
  }
});

function urlcleaner(urlchiffree) {
    $("*").css( 'cursor', 'not-allowed' );
    setTimeout(function(){ $("*").css( 'cursor', 'auto' ); }, 500);
    var xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function() {
        if (xhttp.readyState === xhttp.DONE) {
            var link = xhttp.getResponseHeader("Location");
            link = decodeURIComponent(link);
            if (link != 'null') { removeaffiliate(link); }
        }
        if (link == 'null') {
            GM_xmlhttpRequest({
                url: urlchiffree,
                makePrivate: "true",
                method: "GET",
                onload: function(response) {
                    var link = response.finalUrl;
                    removeaffiliate(link);
                }
            });
        }
    };
    xhttp.open("HEAD", urlchiffree, true);
    xhttp.send();
}

